import Head from "next/head";
import Container from "./components/Container";

const Index = () => {
  return (
    <Container>
      <Head>
        <title>Next.js Project - Home</title>
      </Head>
      <h1>Index 1</h1>
    </Container>
  );
};

export default Index;
